INSERT INTO `newsfeeds` (`id`, `title`, `body`, `remember_token`, `created_at`, `updated_at`) VALUES
(1, 'SMILESTEADILY- JOURNEY OF A WEEK SO FAR', 'On the first premise, we give all glory to the Almighty God for granting us the grace of sustenance up to this time, This noble platform which was borne out of a strong vision and desire to put smiles on the faces of millions of people across board came into operation on Tuesday 15th August, 2017; which marks a week BIRTHDAY today.\n\nConsidering the stiff competition in the Peer-to-Peer Circle in Nigeria, with many platforms springing up daily with the sole intention of robbing people of their hard-earned money, we can tell you that the journey has not been an easy one. No thanks also to the agents of darkness who derives joy in pulling down any good and working system. Nevertheless, the grace of Almighty God, SS Team commitment and the resilience of our matured participants, have kept us going.\n\nWe want to use this medium to appreciate you our noble, matured and committed participants for your constant support and love for this platform. We want to assure you that we shall keep our words in ensuring excellent service delivery that will keep you smiling steadily at all times.\n\nAt this juncture, we want us all to know that SUSTAINABILITY remains the major part of our core values and this is held in high esteem in SMILESTEADILY. This platform, is not meant for those who have the ‘HIT & RUN MENTALITY’. We want to be around for years! We want to create a society where millions will be lifted out of poverty and begin to enjoy their lives in awesome comfort.\n\nOur platform delivers 100% returns in 15 days and will ensure this benefits all and sundry.  Currently, we are running what we tagged: EARLY GS PROMOTION, which was designed to show love and appreciation to some of our early participants by allowing them to have their returns earlier than 15 days for the promo period which lasts two weeks from our launch. It should however be noted, that the promotion is for only selected participants who made an early Give Smile (GS) on the platform. Anyone who doesn’t fall into the promo category should not be discouraged, as the journey of your 15 days is surely close by.\n\nLet us all continue to go our normal way of GIVING & RECEIVING SMILES; make all our payments when our GS Orders are matched, confirm payment when received and continue to spread the good news of SMILESTEADILY among friends and families. It can only get better and better with SMILESTEADILY. Any form of complaints and issues should be channeled to our support crew who are ever-positioned to give you helping hand at all time.\n\nWe love you, and will continue to put unending smiles on your faces.  \nThank you.', 'Sv2YER6Tn5thDM1EgYihXP1zbIqxd2ZE5tdAvLt3', '2017-08-22 11:05:01', '2017-08-22 11:05:01'),
(2, 'SMILESTEADILY- ANOTHER NEW WEEK OF GIANT STRIDES.', '“Tough times don’t last but tough people do”- NAPOLEON HILL\r\n\r\nHello SMILERS,\r\n\r\nIt is our utmost pleasure to celebrate another week of excellence together, a milestone that makes SMILESTEADILY two weeks old baby. As a baby, we have made some giant strides and also faced with quite tremendous challenges within our existence period so far.\r\n\r\nIn terms of challenges, prominent in recent time was the inability of some of our participants to view their transactions details on their dashboards which prevents some people from making payments and also get confirmed appropriately. Our Technical Team displayed a huge sense of responsibility as usual in rising to the occasion; an action which made all transactions details restored back on the affected POs within 48 hours. As regards the new RS Date of 12th September being seen by everyone as their New RS Date, that is being currently worked on and all RS will take their normal positions in no time. \r\n\r\nAs a P2P Platform, we have been able to prove positive points in terms of COMMUNICATION, FIDELITY & REWARD; all geared towards great SUSTAINABILITY and putting smiles on the faces of all members of our community. We want to assure you that we will not rest on our oars until we make millions of people smile steadily across board.\r\n\r\nMoreover, we can see that our dashboards have worn some new features which makes more pleasant, beautiful & easy experience for you our ESTEEMED PARTICIPANTS. We want to assure you that we will be doing all needed to make your experience on this platform the best ever.\r\n\r\nAgainst all these backgrounds, all SMILERS are enjoined to go back their normal business of GIVING SMILE, CONFIRMING PAYMENTS, RECOMMITTING and SPREADING THE GOOD NEWS OF SMILESTEADILY ACROSS BOARD. All payments already received should be confirmed by the receiver, all those who paid and unable to upload their POPs should do that now and get their payments confirmed.\r\n\r\nAs regards the EARLY GS PROMOTION that we have been running in the past two weeks, this has come to end now and all participants are enjoined to look forward to their normal RS Dates for payments.\r\n\r\nNo account will be blocked within the next 24 hours, in order to give ample room for fulfillment of duties with regards to all accounts that are already matched either to GIVE or RECEIVE SMILE. Let us all remember that SMILESTEADILY is YOU & I, we built this community as ours and we are expected to do all necessary to make it much STRONGER, BETTER AND SUSTAINABLE. \r\n\r\n“I cannot do what you can do, you cannot do what I can do; but together we can do GREAT THINGS”- MOTHER THERESA.\r\n\r\nSMILESTEADILY loves YOU.', 'dbWEy6wLMoM09AIQdsRUVdSCJCcnG9hJZ1WR6jOT', '2017-08-29 12:07:05', '2017-08-29 12:07:05'),
(3, 'HAPPY NEW MONTH & EID-MUBARAK', 'Hello SMILERS,\r\n\r\nIt is our pleasure to say Happy New Month to you all SMILERS and also wish our MUSLIM SMILERS the very best of SALLAH CELEBRATION. We pray the joy of the season will abide with us all and the new month will be more rewarding than the earlier ones.\r\n\r\nWe will like to use this medium to intimate all who have their RS Date matured and have not been able to receive smile to calm down and relax their nerves, as their smile is underway. The slight delay is borne out of the need to ensure that our Auto Matching Dispatcher is in good state to avoid any form of mismatching or overmatching. All is in good state now and the dispatcher is already at work.\r\n\r\nLet’s all kindly keep tab on our dashboards and ensure we fulfill all our payments and confirmation duties when matched. It is noteworthy at this point to reiterate the point again that SMILESTEADILY is not a HIT & RUN PLATFORM; as we are here to stay.  WE ARE VERY STRONG & HEALTHY and with you we will be STRONGER & HEALTHIER. We know that many of us have had ugly experiences with so many failed platforms, but we want to assure you that we will do our very best to make you smile steadily as long as you are on this platform which is the true home of CREDIT ALERTS.\r\n\r\nWhoever that has any form of inquiry or complaints should endeavour to make use of our support channels and such person is assured of prompt response and intervention.\r\nOnce more happy New Month & exciting Sallah Celebration.\r\n\r\nSMILESTAEDILY loves YOU.', 'A0t03alF6yf2yKAz9doEDY1FZU1TiEcvsuFt8o6v', '2017-09-01 10:55:50', '2017-09-01 10:55:50'),
(4, 'GS & RS COMMITMENT- SPIRIT OF A TRUE SMILER', 'Hello SMILERS, \r\n\r\nTrust the holiday has been enjoyable. \r\n\r\nThis is to address some complaints coming from some of our participants that are matched to pay out the 80% of their new GS while expecting to RS on the earlier one. \r\n\r\nThose 80% called by the dispatcher are already due as we can see that they are from 9 days maturity upward. Most of those affected actually recommitted earlier because they wanted to benefit from the EARLY GS PROMOTION. As we all know that the promotion couldn''t cover everyone, as we are back in our normal 15 days circle. \r\nAgainst this backdrop, we want to enjoin all affected to go ahead and make their payments, as their earlier due RS is already on queue to be matched. Many have actually been matched already at the point of writing this note. \r\n\r\nThe platform is strong, healthy and getting better everyday. Let''s do our best to make it the best it should be by fulfilling all our pledges without delay. No need for unnecessary fear or panic, as we are here to stay and make a positive impact by putting unending smiles into people''s faces. \r\n\r\nKindly don''t hesitate to channel any of your complaints and inquiries to our online live agents and Groups Admins. They are well-positioned to put smiles  on your faces too \r\n\r\nSMILESTEADILY loves you.', '2WMAHUnAL9xG46NkNcf979AOFdYdhbZj8uUxPCCy', '2017-09-03 01:07:04', '2017-09-03 01:07:04');
